package com.zaritcare.data.mocks.advice

import javax.inject.Inject

class AdviceDaoMock @Inject constructor() {
    private val balanceImage: String = ""
    private val bedImage: String = ""
    private val doctorImage: String = ""
    private val smileImage: String = ""
    private val tips = mutableListOf<AdviceMock>(
        AdviceMock(
            id = 1,
            title = "Sonre",
            description = "Sonrer reduce los niveles de hormonas causantes del estrs y la disminucin de la presin arterial.",
            image = smileImage
        ),
        AdviceMock(
            id = 2,
            title = "Duerme",
            description = "Esto ayuda a disminuir el estrs y mejorar el estado de nimo.",
            image = bedImage
        ),
        AdviceMock(
            id = 3,
            title = "Prioriza",
            description = "Nos ayuda a aproximarnos y relacionarnos con los dems, creando vnculos con nuestro entorno a la vez.",
            image = balanceImage
        ),
        AdviceMock(
            id = 4,
            title = "Visita al mdico",
            description = "Conocer el estado de tu cuerpo a travs de un diagnstico profesional, no solo te ayudar a ser precavido o controlar enfermedades, tambin te brindar tranquilidad.",
            image = doctorImage
        )
    )

    fun get(): MutableList<AdviceMock> = tips
    fun get(id: Int): AdviceMock? = tips.find { advice -> advice.id == id }
    fun insert(advice: AdviceMock) = tips.add(advice)
    fun update(newAdvice: AdviceMock) {
        val index: Int = tips.indexOfFirst { advice -> advice.id == newAdvice.id }
        if (index != -1) tips[index] = newAdvice
    }
    fun delete(id: Int) {
        val index = tips.indexOfFirst { advice -> advice.id == id }
        if (index != -1) tips.removeAt(index)
    }
}